            await RequestWindowChannel.Writer.WaitToWriteAsync();
            await RequestWindowChannel.Writer.WriteAsync(new Tuple<string, string>(domain, sitekey));
            await ReceiveWindowChannel.Reader.WaitToReadAsync();
            var windowInstance = await ReceiveWindowChannel.Reader.ReadAsync();
            windows.TryAdd(sitekey, windowInstance);
        }

        public static void RemoveWindow(string sitekey) {
            windows.TryRemove(sitekey, out _);
        }
    }
}
